aside {
	// max-width: 32.5vw;

	// .sidebar {
	// 	max-width: 32.5vw;
	// }

	.search-zone {
		margin-bottom: 1.5rem;
		box-shadow: 0 3px 6px rgba(0,0,0,0.16), 0 3px 6px rgba(0,0,0,0.23);

		form.search-form {
			.form-group {
				display: flex;

				input[type="text"] {
					flex: 1 1 0;
				}

				button[type="submit"] {
					padding: 0.5rem 1rem;
					background: $dark;
					border-left: none;
					border-right: 1px solid $dark;
					border-top: 1px solid $dark;
					border-bottom: 1px solid $dark;
					color: rgba(255,255,255,0.75);
					transition: all ease .15s;

					i {
						color: inherit;
					}

					&:hover {
						color: rgba(255,255,255,0.9);
					}

					&:focus {
						outline: none;
					}
				}
			}
		}

		.search-input {
			width: 100%;
			border: 1px solid $dark;
			border-radius: 0;
			padding: 0.4rem 1rem;

			&:active, &:focus {
				outline: none;
			}
		}

		input.search-input::placeholder {
			font-style: italic;
			font-weight: 400;
		}
	}

	.social-zone {
		border: 1px solid var(--dark);
		margin-bottom: 1.5rem;
		box-shadow: 0 3px 6px rgba(0,0,0,0.16), 0 3px 6px rgba(0,0,0,0.23);

		h4 {
			font-size: .98rem;
			background: $dark;
			color: #fff;
			padding: .5rem 2rem;
			border-radius: 0;
			font-weight: 400;
			border-bottom: 1px solid #fff;
			margin-bottom: 0;
		}

		p {
