		}

		ul {
			padding: 1rem 0 0.75rem 1.5rem;
			display: flex;

			li:nth-child(1) {
				padding-right: 0.25rem;
			}

			li:nth-child(2) {
				padding-left: 0.25rem;
			}

			li {
				padding-bottom: .2rem;

				a {
					color: $dark;
					font-weight: 600;
					transition: all ease .4s;

					.fab {
						&:before {
							// margin-right: 0.7rem;
							margin-right: 0;
						}
					}

					.fa-stack {
						height: 1.75em;
						line-height: 1.75em;
						width: 2em;
					}

					.fa-2x {
						font-size: 1.75em;
					}

					.fa-stack-2x {
						font-size: 1.75em;
					}

					.fa-stack-1x {
						font-size: 0.85em;
					}

					&.fb:hover {
