	}

	.recent-movies, .recent-series {
		margin-bottom: 2rem;
		background: #fff;
		color: #fff;
		border: 1px solid $dark;
		box-shadow: 0 3px 6px rgba(0,0,0,0.16), 0 3px 6px rgba(0,0,0,0.23);

		h4 {
			font-size: .98rem;
			background: $dark;
			color: #fff;
			padding: .5rem 2rem;
			border-radius: 0;
			font-weight: 400;
			border-bottom: 1px solid #fff;
			margin-bottom: 0;
		}

		.grid-of-movies, .grid-of-series {
			display: grid;
			grid-template-columns: repeat(3, 1fr);
			grid-gap: 1rem;
			padding: 1.6rem;

			.movie, .serie {
				position: relative;

				img {
					width: 112px;
					height: 112px;
				}
			}

			.layer {
				box-shadow: 0 3px 6px rgba(0,0,0,0.16), 0 3px 6px rgba(0,0,0,0.23);
				height: 112px;

				&:after {
					box-shadow: inset 112px 112px rgba(0,0,0,.2); 
					content: '';
					display: block;
					width: 100%;
					height: 100%;
					position: absolute;
					top: 0;
				}
			}
		}
	}

	.quote-of-the-day {
		border: 1px solid $dark;
		margin-top: 1.5rem;
		box-shadow: 0 3px 6px rgba(0,0,0,0.16), 0 3px 6px rgba(0,0,0,0.23);

		h4 {
			font-size: .98rem;
			background: #fff;
			color: $dark;
			padding: .5rem 2rem;
			border-radius: 0;
			font-weight: 400;
			border-bottom: 1px solid $dark;
			margin-bottom: 0;
		}

		div {
			background: $dark-gray;
			color: #fff;
			margin-bottom: 0;
			padding: 1rem 2.5rem;
		}

		.dynamic-hero-quote {
			font-style: italic;

			i {
				color: #fff;
			}
		}

		hr {
			width: 20%;
			border-top: 1px solid #6c757d;
			margin-bottom: 0.5rem;
		}

		.quote-footer {
			padding: 0;
		}
	}

	.suscription-zone {
		border: 1px solid $dark;
		margin-top: 1.5rem;
		box-shadow: 0 3px 6px rgba(0,0,0,0.16), 0 3px 6px rgba(0,0,0,0.23);

		h4 {
			font-size: .98rem;
			background: #fff;
			color: $dark;
			padding: .5rem 2rem;
			border-radius: 0;
			font-weight: 400;
			border-bottom: 1px solid $dark;
			margin-bottom: 0;
		}

		div {
			background: $dark-gray;
			color: #fff;
			margin-bottom: 0;
			padding: 1rem 2.5rem;
		}

		.email {
			width: 80%;
			padding: .5rem;
			color: $dark;
			font-weight: 700;
			border: 1px solid $dark;
			transition: all ease .3s;

			&:active, &:focus {
				box-shadow: 0 1px 2px rgba(255,255,255,0.12), 0 1px 1px rgba(255,255,255,0.24);
			}

			&::placeholder {
				font-style: italic;
				font-weight: 400;
			}
		}
	}

	.tutorials-zone {
		border: 1px solid $dark;
		margin-top: 1.5rem;
		box-shadow: 0 3px 6px rgba(0,0,0,0.16), 0 3px 6px rgba(0,0,0,0.23);

		h4 {
			font-size: .98rem;
			background: $white;
			color: $dark;
			padding: .5rem 2rem;
			border-radius: 0;
			font-weight: 400;
			border-bottom: 1px solid $dark;
			margin-bottom: 0;
		}

		div {
			background: $dark-gray;
			color: #fff;
			margin-bottom: 0;
			padding: 1.4rem 2.5rem;

			p {
				line-height: 1.3;
				margin-bottom: 1.5rem;
			}

			a {
				color: #fff;
				border: 1px solid $gray;
				padding: .2rem 2rem;
				transition: all ease .3s;
				box-shadow: 0 1px 2px rgba(0,0,0,.16), 0 1px 2px rgba(0,0,0,.23);

				&:hover {
					background: transparent;
					box-shadow: 0 0.5px 0.5px rgba(255,255,255,.16), 0 -0.5px 0.5px rgba(255,255,255,.16);
				}
			}
		}
	}
}

